import React from 'react';
import logo from '../images/logo.png';



const Header = (props) => {
  return(
<>
  <img src={logo} className='logo' alt="Girl in a jacket"></img>
  <h1>TIC TAC TOE</h1>
  <button>Start</button>
</>
);
}

export default Header;
